import React, { useEffect, useState } from "react";

const StateWise = () => {
  const [] = useState();

  const getCovidData = async () => {
    const res = await fetch("https://data.covid19india.org/data.json");
  };

  useEffect(() => {
    getCovidData();
  }, []);
  return (
    <>
      <h1>India Covid-19 DashBoard</h1>
    </>
  );
};

export default StateWise;
